import React from 'react'
import Modal from 'react-bootstrap/Modal'
import ModalHeader from ''
import Button from 'react-bootstrap/Button'

function ApplicationSubmition () {
    const [show, setShow] = useState(false);
    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

        return (
            // <div  style ={{backgroundColor: '#d0e1e1',height: '100vh'}} >
            //    <h1 style= {{marginTop: '50px',marginLeft: '20px',fontSize: '75px',fontStyle:'bold'}}> Thank you  Submittion accepted will contact you soon!</h1>
            //    <a href="/favorites"><h1 style= {{marginLeft: '50px' ,fontSize:'50px' }} > back </h1> </a>
            // </div> 
            <>
            <Button variant="primary" onClick={handleShow}>
              Launch demo modal
            </Button>

            <Modal show={show} onHide={handleClose}>
              <Modal.Header closeButton>
                <Modal.Title>Modal heading</Modal.Title>
              </Modal.Header>
              <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
              <Modal.Footer>
                <Button variant="secondary" onClick={handleClose}>
                  Close
                </Button>
                <Button variant="primary" onClick={handleClose}>
                  Save Changes
                </Button>
              </Modal.Footer>
            </Modal>
          </>
        );

}

export default ApplicationSubmition
